import axios from "axios"
const { REACT_APP_BASE_URL } = process.env;
export const getSession = (headers) => {
    return new Promise((resolve, reject) => {
        axios.post(REACT_APP_BASE_URL + "/session/login/", {headers:headers})
        .then((res) => {
            resolve(res)
        })
        .catch((error) => {
            reject(error)
        })
    }) 
}
